import { useState } from 'react'
import './Form.css'
export default function Form({ }) {
    const [video, setVideo] = useState({
        time: '1 month ago',
        channel: 'Coder Dost',
        verified: true,
    });
    const [name, setName] = useState("Himannshu")
    function handleOnChange(ev) {
        console.log(ev.target.value)
        setName(ev.target.value)
    }

    return (
        <div className="form-div">
            <h1>Name : {name}</h1>
            <form>
                <input name="title" type="text" onChange={(ev) => handleOnChange(ev)} />
                <input name="fname" type="text" onChange={(ev) => handleOnChange(ev)} />
                <input type="submit" />
            </form>
        </div>
    )
}
